import React from "react";
import {FaCloudDownloadAlt} from 'react-icons/fa'
import { Navbar, Nav, Container } from "react-bootstrap";


const Header = () => {
  return (
    <Navbar className="header">
      <LinkContainer to="/">
      <h3>Find Your Farm</h3>
      </LinkContainer>
    </Navbar>
  );
};

export default Header;
